DESCRIPTION
Phaedra, a beautiful Egyptian Princess, lays dead in her pyramid tomb mourned by her lover, the handsome Aramata, a Captain of the Guard. With help from the gods, some ancient scrolts, &amp; the secret of the Golden Lotus, he is able to bring her back to life. Our story takes us from the ancient era of the Pharobs, an archeologist, searching for the secret, and a separate group of foreign spies also after the magic formula, all for their individual purposes. Join this group of good and bad on a journey of intrigue and sexual mystique of the Golden Lotus.

Starring: Victoria, Paris, Sharon Kane, Viper, Kassi Nova, Ms. Sharon, Mitchell, Sasha, Aja.
